import React from "react";

import "./topbar.css";

export const TopBar = () => {
  return (
    <div className="topbar">
      <h1 className="topbar-text">
        Budget: XXXX.XX
        <br />
        Savings: XXXX.XX
        <br />
        Debt: XXXXX.XX
      </h1>
    </div>
  );
};
